import Link from 'next/Link';

const Navbar = () => (
  <nav id="navbar">
    <div className="container">
      <div id="nav-content">
        <div id="logo">
          <Link href="/">
            <a>
              <h1>CodeTunes</h1>
            </a>
          </Link>
        </div>
        <ul id="nav-menu">
          <Link href="/about">
            <a className="nav-link">About</a>
            </Link>
        </ul>
      </div>
      <div id="user-search">
        <input type="text" name="profile_search" id="main-searchbar"/>
      </div>
    </div>
    

    <style jsx>{`
    
      #navbar {
        padding: 1.5rem 0;
        border-bottom: 1px solid white;
      }
    
      #nav-content {
        display: flex;
        justify-content: space-between;
      }

      #logo h1 {
        color: white;
        font-size: 2rem;
        text-transform: uppercase;
      }

      .nav-link {
        color: white;
      }

      #user-search {
        margin: auto;
      }



    `}</style>
  </nav>
)

export default Navbar;
